import React from "react";
import "./sign.css";
import amzon from "./Screenshot 2023-05-09 065016.png";
function Signin() {
  return (
    <div className="signin-main">
      <img className="img" src={amzon}></img>
      <div className="box_ctn">
        <h3 className="head">Sign in</h3>
        <p className="para">Enter mobile phone number or email</p>
        <input type="text" className="enter_email"></input>
        <button className="button">Continue</button>
        <p className="policy">
          By continuing, you agree to Amazon's{" "}
          <a className="link1">Conditions of Use</a> and{" "}
          <a className="link2">Privacy Notice.</a>
        </p>
      </div>
    </div>
  );
}
export default Signin;
